webpackJsonp([0x5fc81e5208868000],{"./node_modules/json-loader/index.js!./.cache/json/javascript-tutorials-construct-javascript-objects-with-functions.json":function(t,e){t.exports={data:{markdownRemark:{html:'<p>Using constructors it is easy to create new objects using a blueprint or constructor. The declaration syntax is a little different but still easy to remember.</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>// Let\'s add the properties engines and seats to the car in the same way that the property wheels has been added below. They should both be numbers.\nvar Car = function() {\n  this.wheels = 4;\n  this.engines = 1;\n  this.seats = 1;\n};\n\nvar myCar = new Car();</code></pre>\n      </div>\n<p>The name of a constructor function usually begins with a capital letter (unlike other functions, which tend to begin with a lowercase character). The uppercase letter is supposed to help remind developers to use the new keyword when they create an object using that function.</p>',fields:{slug:"/javascript/tutorials/construct-javascript-objects-with-functions/"},frontmatter:{title:"Construct JavaScript Objects with Functions"}}},pathContext:{slug:"/javascript/tutorials/construct-javascript-objects-with-functions/"}}}});
